export default function Customer(props) {
  function CustomerProfile(){
    return(
      <div>
        <h1>{props.name}</h1>
      </div>
    )
  }

  function CustomerInfo(){
    return(
      <div>
        <h1>CustomerInfo</h1>
      </div>
    )
  }
  return (
    <div>
      <CustomerProfile/>
      <CustomerInfo/>
    </div>
  );
}
